import { Box, Stack, Text, ColorPicker } from '@mantine/core'
import React from 'react'

const Layout3 = () => {
  return (
    <Box h={200} bg="gray.3">
      <Stack>
        <Text>Backgroud Color</Text>
        <ColorPicker fullWidth size="sm" format="rgba" />
      </Stack>
    </Box>
  )
}

export default Layout3
